% --- Executes on button press in pushbutton1.
function pushbutton1_Callback(hObject, eventdata, handles)
% hObject    handle to pushbutton1 (see GCBO)
% eventdata  reserved - to be defined in a future version of MATLAB
% handles    structure with handles and user data (see GUIDATA)
%popup_sel_index = get(handles.popupmenu1, 'Value');


vol_seq = 0.15:0.01:0.7;
lenvol = length(vol_seq);
gamma_seq = zeros(lenvol,1);
tau = str2double( get( handles.edit4  , 'String' ) );
K = str2double( get( handles.edit3  , 'String' ) );
s = str2double( get( handles.edit6  , 'String' ) );
r = str2double( get( handles.edit2  , 'String' ) );

for i = 1:lenvol
gamma_seq(i) = blsgamma(s,K,r,tau,vol_seq(i),0);
end

cla( handles.axes1 , 'reset' )
axes( handles.axes1 )

plot(vol_seq,gamma_seq)
legend('gamma vs vol')

set( handles.axes1 , 'FontSize' , 10 )


%% plot delta vs vol

call_delta_seq = zeros(lenvol,1);
put_delta_seq = zeros(lenvol,1);

for i = 1:lenvol
[call_delta_seq(i),put_delta_seq(i)] = blsdelta(s,K,r,tau,vol_seq(i),0);
end

% figure()
% plot(vol_seq,call_delta_seq)
% legend('call delta vs vol')

cla( handles.axes2 , 'reset' )
axes( handles.axes2 )

option_type = get( handles.edit5  , 'String' );

direction = get( handles.edit7  , 'String' );

switch direction
    case {'long','1'}

        switch option_type
            case {'call','Call'}
                plot(vol_seq,call_delta_seq)
                legend('call delta vs vol','Location','best')
            case {'put','Put'}
                plot(vol_seq,put_delta_seq)
                legend('put delta vs vol','Location','best')
        end
        
    case {'short','-1'}
         switch option_type
            case {'call','Call'}
                plot(vol_seq,-call_delta_seq)
                legend('call delta vs vol','Location','best')
            case {'put','Put'}
                plot(vol_seq,-put_delta_seq)
                legend('put delta vs vol','Location','best')
         end       
end
        
set( handles.axes2 , 'FontSize' , 10 )

%% plot delta vs S

d2 = s*0.05;
vol = str2double( get( handles.edit8  , 'String' ) );

s_seq = (s-d2):0.001:(s+d2);
lenvol = length(s_seq);

call_delta_seq = zeros(lenvol,1);
put_delta_seq = zeros(lenvol,1);

for i = 1:lenvol
[call_delta_seq(i),put_delta_seq(i)] = blsdelta(s_seq(i),K,r,tau,vol,0);
end

cla( handles.axes3 , 'reset' )
axes( handles.axes3 )

option_type = get( handles.edit5  , 'String' );

direction = get( handles.edit7  , 'String' );

switch direction
    case {'long','1'}

        switch option_type
            case {'call','Call'}
                plot(s_seq,call_delta_seq)
                legend('call delta vs S','Location','best')
            case {'put','Put'}
                plot(s_seq,put_delta_seq)
                legend('put delta vs S','Location','best')
        end
        
    case {'short','-1'}
         switch option_type
            case {'call','Call'}
                plot(s_seq,-call_delta_seq)
                legend('call delta vs S','Location','best')
            case {'put','Put'}
                plot(s_seq,-put_delta_seq)
                legend('put delta vs S','Location','best')
         end       
end
        
set( handles.axes3 , 'FontSize' , 10 )


d1 = s*0.01;
s_seq2 = [s-d1,s,s+d1];
len2 = length(s_seq2);
call_delta_seq2 = zeros(len2,1);
put_delta_seq2 = zeros(len2,1);

for i = 1:len2
[call_delta_seq2(i),put_delta_seq2(i)] = blsdelta(s_seq2(i),K,r,tau,vol,0);
end


switch direction
    case {'long','1'}

        switch option_type
            case {'call','Call'}
                set( handles.text8  , 'String', num2str(call_delta_seq2(3)-call_delta_seq2(2)) )
            case {'put','Put'}
                plot(s_seq,put_delta_seq)
                set( handles.text8  , 'String', num2str(put_delta_seq2(3)-put_delta_seq2(2)) )
        end
        
    case {'short','-1'}
         switch option_type
            case {'call','Call'}
                set( handles.text8  , 'String', num2str(call_delta_seq2(3)-call_delta_seq2(2)) )
            case {'put','Put'}
                set( handles.text8  , 'String', num2str(put_delta_seq2(3)-put_delta_seq2(2)) )
         end       
end






